import React from "react";
import bannerImg from "../../images/community/banner.jpg";

const Banner = () => {
  const bannerStyle = {
    position: "relative",
    marginTop: "64px",
    height: "400px", // Adjust the height as desired
  };

  const imageStyle = {
    width: "100%",
    height: "100%",
    objectFit: "cover",
    filter: "brightness(50%)",
  };

  const titleStyle = {
    fontSize: "4rem",
    fontWeight: "bold",
    color: "white",
    position: "absolute",
    top: "50%",
    left: "50%",
    transform: "translate(-50%, -50%)",
  };

  return (
    <div style={bannerStyle}>
      <img
        src={bannerImg}
        alt="banner"
        style={imageStyle}
      />
      <h1 style={titleStyle} data-aos="fade-up" data-aos-delay="100">Our Community</h1>
    </div>
  );
};

export default Banner;
